      [Fact]
      public async Task ExistingDuplicateUbrns_Exception()
      {
        // arrange
        var referral1 = RandomEntityCreator.CreateRandomReferral();
        _context.Referrals.Add(referral1);
        var referral2 = RandomEntityCreator.CreateRandomReferral(
          ubrn: referral1.Ubrn);
        _context.Referrals.Add(referral2);
        _context.SaveChanges();

        ReferralCreate model = ValidReferralCreate();
        model.Ubrn = referral1.Ubrn;

        // act
        Exception ex = await Record.ExceptionAsync(
          () => _service.CreateReferral(model));

        // assert
        ex.Should().BeOfType<ReferralNotUniqueException>();
        ex.Message.Should().StartWith($"Found 2 existing referrals with UBRN " +
          $"{model.Ubrn}. There can be only one. Examine referrals with " +
          "Id's of");
        ex.Message.Should().Contain(referral1.Ubrn);
        ex.Message.Should().Contain(referral2.Ubrn);
      }

