      [Fact]
      public async Task ExistingUbrn_CancelledWithoutProv_Rejected()
      {
        // arrange
        var mockService = new Mock<ReferralService>(
            _context,
            _serviceFixture.Mapper,
            _providerService,
            _mockDeprivationService.Object,
            _mockPostcodeService.Object,
            _mockPatientTriageService.Object,
            _mockOdsOrganisationService.Object);
        mockService.CallBase = true;
        mockService.Object.User = GetClaimsPrincipal();

        mockService.Setup(s => s.UpdateGpReferral(It.IsAny<IReferralUpdate>()))
          .ReturnsAsync(new Referral());

        var existingReferral = RandomEntityCreator.CreateRandomReferral(
          status: ReferralStatus.CancelledByEreferrals);
        _context.Referrals.Add(existingReferral);
        await _context.SaveChangesAsync();

        ReferralCreate model = ValidReferralCreate();
        model.Ubrn = existingReferral.Ubrn;

        // act 
        IReferral createdReferral = 
          await mockService.Object.CreateReferral(model);

        // assert
        mockService.Verify(
          ms => ms.UpdateGpReferral(It.IsAny<IReferralUpdate>()), Times.Once);

        var rejetedReferal = _context.Referrals
          .Single(r => r.Id == existingReferral.Id);

        rejetedReferal.Status.Should()
          .Be(ReferralStatus.RejectedToEreferrals.ToString());
        rejetedReferal.StatusReason.Should()
          .Be("UBRN was removed and re-add by GP practice.");
      }

