      private string SampleCriDocumentBase64()
      {
        return
          @"";
      }

      private void UniversalAsserts(
        ReferralCreate model,
        IReferral result,
        DateTimeOffset methodCallTime)
      {
        result.Should().BeOfType<Referral>();

        result.IsActive.Should().BeTrue("because it has just been created");
        result.ModifiedAt.Should().BeAfter(methodCallTime);
        result.ModifiedByUserId.Should().Be(_service.User.GetUserId());

        result.ConsentForFutureContactForEvaluation.Should().BeNull();
        result.DateCompletedProgramme.Should().BeNull();
        result.DateOfProviderSelection.Should().BeNull();
        result.DateStartedProgramme.Should().BeNull();
        result.ProgrammeOutcome.Should().BeNull();
        result.TriagedCompletionLevel.Should().BeNull();
        result.TriagedWeightedLevel.Should().BeNull();
        result.Calls.Count.Should().Be(0);
        result.TextMessages.Count.Should().Be(0);
      }
    }
